	function convert_aaguid_to_hex($bin_aaguid)
	{
		$hex_aaguid = bin2hex($bin_aaguid);

		return sprintf(
			'%s-%s-%s-%s-%s',
			substr($hex_aaguid, 0, 8),
			substr($hex_aaguid, 8, 4),
			substr($hex_aaguid, 12, 4),
			substr($hex_aaguid, 16, 4),
			substr($hex_aaguid, 20)
		);
	}

	function get_relying_party_id()
	{
		$parsed_url = wp_parse_url(get_option('siteurl'));

		return strval($parsed_url['host'] ?? '');
	}

	function get_login_options($challenge)
	{
		$options = [
			'challenge' => $challenge,
			'rpId' => $this->get_relying_party_id(),
			'allowCredentials' => [],
			'userVerification' => 'required', // preferred / discouraged
			'timeout' => (5 * 60 * 1000),
		];

		return $options;
	}

	function get_by_credential_id($credential_id)
	{
		global $wpdb;

		return $wpdb->get_row($wpdb->prepare("SELECT * FROM ".$wpdb->base_prefix."secure_passkeys_webauthns WHERE credential_id = %s", $credential_id));
	}

	function base64url_decode($string)
	{
		return base64_decode(strtr($string, '-_', '+/').str_repeat('=', 3 - (3 + strlen($string)) % 4));
	}

	function do_login_action($challenge, $credentials)
	{
		$relying_party_id = $this->get_relying_party_id();

		$webauthn = new Web_Authn($relying_party_id, $relying_party_id);

		$credential_id = $this->get_raw_credential_id($credentials['rawId']);

		$data = $this->get_by_credential_id($credential_id);

		if(is_null($data)) // || !$data->is_active
		{
			throw new Exception('Invalid credentials');
		}

		$webauthn->processGet(
			$this->base64url_decode($credentials['response']['clientDataJSON']),
			$this->base64url_decode($credentials['response']['authenticatorData']),
			$this->base64url_decode($credentials['response']['signature']),
			$data->public_key,
			$this->base64url_decode($challenge)
		);

		return $data;
	}

	function do_signin_action($user_id)
	{
		$user = get_userdata($user_id);

		if(!$user)
		{
			return false;
		}

		wp_set_current_user($user_id, $user->user_login);

		wp_set_auth_cookie($user_id, true);

		do_action('wp_login', $user->user_login, $user);

		return true;
	}

	function get_user_full_name($user_id)
	{
		$first_name = get_user_meta($user_id, 'first_name', true);
		$last_name = get_user_meta($user_id, 'last_name', true);

		$full_name = trim($first_name.' '.$last_name);

		if(empty($full_name))
		{
			$full_name = get_the_author_meta('user_email', $user_id);
		}

		return trim($full_name);
	}

	function do_enable_options_action($user_id, $challenge)
	{
		global $wpdb;

		$relying_party_id = $this->get_relying_party_id();

		$username = $this->get_user_full_name($user_id);

		$options = [
			'challenge' => $challenge,
			'rp' => [
				'id' => $relying_party_id,
				'name' => $relying_party_id,
			],
			'user' => [
				'id' => base64_encode($user_id),
				'name' => $username,
				'displayName' => $username,
			],
			'pubKeyCredParams' => [
				[
					'type' => 'public-key',
					'alg' => -7,
				],
				[
					'type' => 'public-key',
					'alg' => -257,
				],
			],
			'attestation' => 'none',
			'extensions' => [
				'credProps' => true,
			],
			'timeout' => (5 * 60 * 1000),
		];

		if($this->is_authenticator_selection_enabled())
		{
			$options['authenticatorSelection'] = $this->get_authenticator_selection();
		}

		$credential_ids = $wpdb->get_results($wpdb->prepare("SELECT credential_id FROM ".$wpdb->base_prefix."secure_passkeys_webauthns WHERE user_id = %d", $user_id));

		$excludeCredentials = array_map(function ($item)
		{
			return [
				'type' => 'public-key',
				'id' => $item->credential_id,
			];
		}, $credential_ids);

		if(!empty($excludeCredentials))
		{
			$options['excludeCredentials'] = $excludeCredentials;
		}

		return $options;
	}

	function is_credential_id_for_user_id($id, $credential_id)
	{
		global $wpdb;

		$record = $wpdb->get_row($wpdb->prepare("SELECT * FROM ".$wpdb->base_prefix."secure_passkeys_webauthns WHERE user_id = %d AND credential_id = %s", $id, $credential_id));

		return !is_null($record);
	}

	function is_security_key_name_for_user_id($id, $security_key_name)
	{
		global $wpdb;

		$record = $wpdb->get_row($wpdb->prepare("SELECT * FROM ".$wpdb->base_prefix."secure_passkeys_webauthns WHERE user_id = %d AND security_key_name = %s", $id, $security_key_name));

		return !is_null($record);
	}

	function do_authn_enable_action($user_id, $challenge, $data, $security_key = null)
	{
		$relying_party_id = $this->get_relying_party_id();

		$webAuthn = new Web_Authn($relying_party_id, $relying_party_id);

		$credential_id = $this->get_raw_credential_id($data['rawId']);
		$clientDataJSON = $this->base64url_decode($data['response']['clientDataJSON']);
		$attestationObject = $this->base64url_decode($data['response']['attestationObject']);
		$challenge = $this->base64url_decode($challenge);

		if($this->is_credential_id_for_user_id($user_id, $credential_id) || $security_key && $this->is_security_key_name_for_user_id($user_id, $security_key))
		{
			throw new Exception();
		}

		$attestation = $webAuthn->processCreate(
			$clientDataJSON,
			new Byte_Buffer($attestationObject),
			$challenge,
			1, //$this->is_user_verification_required()
		);

		return [
			'user_id' => $user_id,
			'credential_id' => $credential_id,
			'public_key' => $attestation->credentialPublicKey,
			'aaguid' => $this->convert_aaguid_to_hex($attestation->AAGUID),
			'last_used_at' => null,
		];
	}

	function authenticator_selection()
	{
		return [
			'residentKey' => 'required',
			'userVerification' => 'required',
		];
	}

	function is_authenticator_selection_enabled()
	{
		$value = $this->authenticator_selection();

		return (!empty($value) && is_array($value));
	}

	function get_authenticator_selection()
	{
		return $this->authenticator_selection();
	}

	function get_raw_credential_id($credential_id)
	{
		return base64_encode($this->base64url_decode($credential_id));
	}

	function generate_fingerprint()
	{
		$userAgent = sanitize_text_field(wp_unslash($_SERVER['HTTP_USER_AGENT'] ?? 'unknown'));
		$ip_address = apply_filters('get_current_visitor_ip', "unknown");
		$acceptLanguage = sanitize_text_field(wp_unslash($_SERVER['HTTP_ACCEPT_LANGUAGE'] ?? 'unknown'));

		$fingerprintData = $userAgent.'|'.$ip_address.'|'.$acceptLanguage;

		$fingerprintHash = hash('sha256', $fingerprintData);

		return $fingerprintHash;
	}

	function generate_challenge($challenge_type, $userId = null)
	{
		global $wpdb;

		$fingerprint = $this->generate_fingerprint();

		$minutes = 5;

		$date = (new DateTime())->add(new DateInterval('PT'.$minutes.'M'));
		$expire_date = $date->format('Y-m-d H:i:s');

		$counter = 0;

		do
		{
			$challenge = base64_encode(random_bytes(32));
			$counter++;

			if(!$this->is_challenge_exists($challenge))
			{
				$data = [
					'user_id' => $userId,
					'blog_id' => $wpdb->blogid,
					'challenge_type' => $challenge_type,
					'challenge' => $challenge,
					'fingerprint' => $fingerprint,
					'expired_at' => $expire_date,
					'created_at' => current_time('mysql'),
					'updated_at' => current_time('mysql')
				];

				$wpdb->insert($wpdb->base_prefix."secure_passkeys_challenges", $data);
				break;
			}
		}

		while ($counter < 10);

		return $challenge;
	}

	function verify_challenge_or_throw_exception($challenge, $challenge_type)
	{
		$fingerprint = $this->generate_fingerprint();

		$record = $this->get_by_challenge_not_used($challenge);

		if(is_null($record))
		{
			throw new Exception('Invalid challenge');
		}

		if($record->challenge_type !== $challenge_type)
		{
			throw new Exception('Invalid challenge type');
		}

		if($record->fingerprint !== $fingerprint)
		{
			throw new Exception('Invalid fingerprint');
		}

		if($record->expired_at < (new DateTime())->format('Y-m-d H:i:s'))
		{
			throw new Exception('Expired challenge');
		}
	}

	function mark_as_used_challenge($challenge)
	{
		global $wpdb;

		$wpdb->update($wpdb->base_prefix."secure_passkeys_challenges", ['used_at' => (new DateTime())->format('Y-m-d H:i:s')], ['challenge' => $challenge]);
	}

	function is_challenge_exists($challenge)
	{
		global $wpdb;

		$record = $wpdb->get_row($wpdb->prepare("SELECT * FROM ".$wpdb->base_prefix."secure_passkeys_challenges WHERE challenge = %s", $challenge));

		return !is_null($record);
	}

	function get_by_challenge_not_used($challenge)
	{
		global $wpdb;

		return $wpdb->get_row($wpdb->prepare("SELECT * FROM ".$wpdb->base_prefix."secure_passkeys_challenges WHERE challenge = %s AND used_at IS NULL", $challenge));
	}

