	function ensure_user_can_perform_action($user_id)
	{
		$has_permission = current_user_can('edit_user', $user_id);

		if(!$has_permission)
		{
			$message = __("You do not have permission to make this request", 'lang_passkeys');

			wp_send_json_error(['message' => $message]);
		}
	}

	function verify_nonce($nonce)
	{
		return wp_verify_nonce(sanitize_text_field($nonce), SECURE_PASSKEYS_NONCE);
	}

	function validate_adminarea_ajax_request()
	{
		$message = '';
		$missing_nonce = false;

		if('POST' !== strtoupper(sanitize_text_field(wp_unslash($_SERVER['REQUEST_METHOD'] ?? ''))))
		{
			$message = __("The request method must be POST", 'lang_passkeys');
		}

		else if(!$this->verify_nonce(sanitize_text_field(wp_unslash($_POST['nonce'] ?? ''))))
		{
			$message = __("Token mismatch, please refresh the page", 'lang_passkeys');
			$missing_nonce = true;
		}

		if(!empty($message))
		{
			wp_send_json_error(['missing_nonce' => $missing_nonce, 'message' => $message]);
		}
	}

	function enqueue_assets($scripts)
	{
		foreach($scripts as $handle => $source)
		{
			$extension = substr(strrchr($source, "."), 1);

			if($extension == 'js')
			{
				mf_enqueue_script($handle, $source);
			}

			else if($extension == 'css')
			{
				mf_enqueue_style($handle, $source);
			}
		}
	}

	function get_js_admin_assets_url($file)
	{
		return SECURE_PASSKEYS_PLUGIN_URL.'assets/admin/js/'.$file;
	}

	function get_css_admin_assets_url($file)
	{
		return SECURE_PASSKEYS_PLUGIN_URL.'assets/admin/css/'.$file;
	}

	function include_vue_adminarea_file($template, $data = [], $load = false)
	{
		$file = realpath(SECURE_PASSKEYS_PLUGIN_DIR.'/src/views/admin/'.$template.'.php');

		if(file_exists(realpath($file)))
		{
			extract($data);

			if(!$load)
			{
				return include realpath($file);
			}

			ob_start();
			require realpath($file);
			return ob_get_clean();
		}

		return '';
	}

	function get_page_resource_key($resources, $hook)
	{
		$found = false;

		foreach(array_keys($resources) as $key)
		{
			$found = (strpos($hook, $key) !== false);

			if($found)
			{
				break;
			}
		}

		return ($found ? $key : '');
	}
