	function check_is_admin_request()
	{
		return strpos(sanitize_text_field(wp_unslash($_SERVER['HTTP_REFERER'] ?? '')), admin_url()) !== false;
	}

	function login_redirect_to()
	{
		return (current_user_can('read') ? admin_url() : home_url());
	}

	function validate_frontend_ajax_request()
	{
		$is_admin_requst = $this->check_is_admin_request();

		switch_to_locale($is_admin_requst ? get_user_locale() : get_locale());

		$message = '';

		if('POST' !== strtoupper(sanitize_text_field(wp_unslash($_SERVER['REQUEST_METHOD'] ?? ''))))
		{
			$message = __("The request method must be POST", 'lang_passkeys');
		}

		else if(!$this->verify_nonce(sanitize_text_field(wp_unslash($_POST['nonce'] ?? ''))))
		{
			$message = __("Token mismatch, please refresh the page", 'lang_passkeys');
		}

		if(!empty($message))
		{
			wp_send_json_error($message);
		}
	}

	function include_view_frontend_file($template, $data = [], $load = false)
	{
		$theme = $default_theme = 'default';

		$theme_paths = $this->get_frontend_themes_paths();

		$theme_path = $theme_paths[$theme];
		$default_path = ($theme_paths['default'] ?? '');

		$file_path = realpath($theme_path.'/'.$template.'.php');

		if(empty($file_path))
		{
			$file_path = realpath($default_path.'/'.$template.'.php');
		}

		$file = $file_path;

		if(!empty($file) && file_exists(realpath($file)))
		{
			extract($data);

			if(!$load)
			{
				return include realpath($file);
			}

			ob_start();
			require realpath($file);
			return ob_get_clean();
		}

		return '';
	}

	function get_frontend_themes_paths()
	{
		return ['default' => SECURE_PASSKEYS_PLUGIN_DIR.'/src/views/frontend'];
	}

