	function delete_passkey()
	{
		global $wpdb;

		$this->validate_adminarea_ajax_request();

		$user_id = intval($_POST['user_id'] ?? 0);
		$id = intval($_POST['id'] ?? 0);
		$admin_id = get_current_user_id();

		$record = $wpdb->get_row($wpdb->prepare("SELECT * FROM ".$wpdb->base_prefix."secure_passkeys_webauthns WHERE id = %d", $id));

		$user_id = intval($record->user_id ?? 0);

		$this->ensure_user_can_perform_action($user_id);

		if(is_null($record))
		{
			wp_send_json_error(['message' => __("The passkey cannot be deleted", 'lang_passkeys')]);
		}

		$deleted = $wpdb->delete($wpdb->base_prefix."secure_passkeys_webauthns", ['id' => $id]);

		if(!$deleted)
		{
			wp_send_json_error(['message' => __("The passkey cannot be deleted", 'lang_passkeys')]);
		}

		$log_type = 'delete';

		if($user_id === $admin_id)
		{
			$admin_id = null;
			$log_type = 'remove';
		}

		//$this->add_record($log_type, $record->user_id, $record->security_key_name, $admin_id, $record->aaguid);

		wp_send_json_success(['message' => __("The passkey deleted successfully", 'lang_passkeys')]);
	}

