	function register_passkey()
	{
		global $wpdb;

		$this->validate_frontend_ajax_request();

		$params = [
			'rawId' => sanitize_text_field(wp_unslash($_POST['rawId'] ?? '')),
			'response' => map_deep(wp_unslash($_POST['response'] ?? []), 'sanitize_text_field')
		];

		$user_id = get_current_user_id();
		$challenge = sanitize_text_field(wp_unslash($_POST['challenge'] ?? ''));

		$security_key_name = 'Passkey-'.(new DateTime())->format('YmdHis');

		try
		{
			$this->verify_challenge_or_throw_exception($challenge, 'registration');

			$data = $this->do_authn_enable_action($user_id, $challenge, $params, $security_key_name);
		}

		catch(Exception $e)
		{
			wp_send_json_error(__("This passkey is already registered. Please use a different one.", 'lang_passkeys'));
		}

		catch(Exception $e)
		{
			wp_send_json_error(__("Failed to register the passkey. Please try again later.", 'lang_passkeys'));
		}

		try
		{
			$data_temp = array_merge($data, [
				'security_key_name' => $security_key_name,
				'blog_id' => $wpdb->blogid,
				'created_at' => current_time('mysql'),
				'updated_at' => current_time('mysql')
			]);

			$wpdb->insert($wpdb->base_prefix."secure_passkeys_webauthns", $data_temp);
			$webauthn_id = $wpdb->insert_id;
		}

		catch(Exception $e)
		{
			wp_send_json_error(__("Failed to register the passkey. Please try again later.", 'lang_passkeys'));
		}

		$this->mark_as_used_challenge($challenge);

		//$this->add_record('register', $user_id, $security_key_name, null, $data['aaguid'], $webauthn_id);

		wp_send_json_success([]);
	}

